package primitives_test

import (
	"encoding/hex"
	"github.com/olympus-protocol/ogen/pkg/primitives"
	testdata "github.com/olympus-protocol/ogen/test"
	"github.com/stretchr/testify/assert"
	"testing"
)

func TestBlock(t *testing.T) {
	correct := testdata.FuzzBlock(2, true, true)
	for _, b := range correct {
		ser, err := b.Marshal()
		assert.NoError(t, err)

		desc := new(primitives.Block)
		err = desc.Unmarshal(ser)
		assert.NoError(t, err)

		assert.Equal(t, b, desc)
	}

	incorrect := testdata.FuzzBlock(2, false, true)
	for _, b := range incorrect {
		_, err := b.Marshal()
		assert.NotNil(t, err)

	}

	nilpointers := testdata.FuzzBlock(2, true, false)
	for _, b := range nilpointers {
		assert.NotPanics(t, func() {
			data, err := b.Marshal()
			assert.NoError(t, err)

			n := new(primitives.Block)
			err = n.Unmarshal(data)
			assert.NoError(t, err)

			assert.Equal(t, b, n)

			assert.Equal(t, uint64(0), n.Header.Slot)
		})

	}
}

func TestBlocksMerkle(t *testing.T) {
	// Serialized snappy compressed block
	blockRaw, err := hex.DecodeString("")

	assert.NoError(t, err)

	b := new(primitives.Block)
	err = b.Unmarshal(blockRaw)
	assert.NoError(t, err)

	assert.Equal(t, "6f898e1ab10de202103781a808c8c1d4c7338e2e82ee102923ef52fb87f04ddf", b.VotesMerkleRoot().String())
	assert.Equal(t, "00fc74e8095904144c1d114ecadee1a03011c327362328c820e24048d6e70d9f", b.TransactionMerkleRoot().String())
	assert.Equal(t, "a6e1310faa96d0fd113203882f3e62f3066a50d4c760f513ef9ac9365e130019", b.TransactionMultiMerkleRoot().String())
	assert.Equal(t, "09a77151b7e32956b159ff97832f41011506b8e1267cd09afa7140b1055505f6", b.DepositMerkleRoot().String())
	assert.Equal(t, "6c1149fd2808d471d809a45711ff4758feda8e37c98c4f343268112cebc2846b", b.ExitMerkleRoot().String())
	assert.Equal(t, "ccefdfcb00a3888f4053573ec6c03b8c40cca6ac5ca003d171a8b1b5abfcce39", b.VoteSlashingRoot().String())
	assert.Equal(t, "ce771d367b79b5d12903c0867eb087b829649936c9e1f93194cf8e730b54f3a0", b.RANDAOSlashingsRoot().String())
	assert.Equal(t, "ad9ffc78402b8991ed4579dbc2dd0d6f7b385919f6aed88d75db8df004abc909", b.ProposerSlashingsRoot().String())
	assert.Equal(t, "b2d8e86eb43c513c68ff40ae5bf448043fb02fb6fa444668084bb900a6334f45", b.GovernanceVoteMerkleRoot().String())
	assert.Equal(t, "c9e47cab75123553518b29608f20131a3402f3ec8e4efa9f7149a3c5724397ce", b.CoinProofsMerkleRoot().String())
	assert.Equal(t, "1659799f0cbaab026041094f0117d09b976218a462aaecf563f7e54910d58bca", b.PartialExitsMerkleRoot().String())
	assert.Equal(t, "1e58985783f5169cf632fc1b4bfc6ff982a0118b9f381972f786d4527711ab0e", b.ExecutionsMerkleRoot().String())

	expectedTx := []string{"7b2f350fc395df8afcf1bc9955b2beef1015719fb5894820ad7068d2ea40bf01", "4013cae996af5ad5f75b0b9e2b9f10f56b5a58456bb4e78e993a0a26212f8aee"}
	txs := b.GetTxs()

	assert.Equal(t, expectedTx, txs)
}
